import React, {Component} from "react";
import '//Toolbar.css';

const toolbar = props => (
    <header>
        <nav>  
        <div></div>
        <div>  <a href="/" > THE LOGO" </a></div>
        <div>
            <ul>
                <li> <a href="/"> UPLOAD </a></li>
                <li> <a href="/"> STATISTICS </a></li>
                <li> <a href="/"> MORE </a></li>

            </ul>

        </div>
        </nav>
    </header> 

);

export default toolbar;
